Plot

When an elite assassin (Ashton Kutcher) marries a

beautiful computer whiz (Katherine Heigl) after a

whirlwind romance, he gives up the gun and settles

down with his new bride. That is, until he learns

that someone from his past has put a contract out

on his life. Now, the couple must go on the run if

they hope to survive and settle the score once and

for all. This action comedy from director Robert

Luketic co-stars Tom Selleck and Catherine O'Hara.




